import React from "react";
import { useParams } from "react-router-dom";
const Blog = () => {
  const [title, body] = useParams();
  return (
    <>
      <div>
        <h1>{title}</h1>
        <p>{body}</p>
      </div>
    </>
  );
};
export default Blog;
